-- Parent Table
CREATE TABLE parent_table (
    age NUMBER NOT NULL,
    sex VARCHAR2(6) NOT NULL,
    PRIMARY KEY (age, sex)
);


-- Social Media Table
CREATE TABLE social_media_table (
    unique_id NUMBER NOT NULL,
    age NUMBER NOT NULL,
    sex VARCHAR2(6) NOT NULL,
    have_sns VARCHAR2(3),
    usual_sns VARCHAR2(9),
    sns_device VARCHAR2(12),
    internet VARCHAR2(17),
    sns_use_length VARCHAR2(18),
    post_freq VARCHAR2(19),
    sns_use_daily VARCHAR2(17),
    sns_use_case VARCHAR2(21),
    sns_friends VARCHAR2(14),
    sns_personal VARCHAR2(12),
    sns_tags VARCHAR2(12),
    sns_content VARCHAR2(29),
    sns_good VARCHAR2(3),
    sns_believe VARCHAR2(3),
    peer_pressure VARCHAR2(3),
    sns_influence VARCHAR2(10),
    sns_wellbeing VARCHAR2(3),
    PRIMARY KEY (unique_id),
    UNIQUE (unique_id),
    FOREIGN KEY (age, sex) REFERENCES parent_table (age, sex)
);


-- Mental Health Table
CREATE TABLE mental_health_table (
    unique_id NUMBER NOT NULL,
    age NUMBER NOT NULL,
    sex VARCHAR2(6) NOT NULL,
    general_health VARCHAR2(9),
    phq_score NUMBER,
    phq_result VARCHAR2(28),
    gad7_score NUMBER,
    gad7_result VARCHAR2(16),
    hopeless VARCHAR2(16),
    overwhelmed VARCHAR2(16),
    exhausted VARCHAR2(16),
    sad VARCHAR2(16),
    rly_sad VARCHAR2(16),
    considered VARCHAR2(16),
    attempted VARCHAR2(16),
    depression_diagnosis VARCHAR2(3),
    therapy VARCHAR2(3),
    depression_medication VARCHAR2(3),
    acha_12months_any_comp NUMBER,
    student VARCHAR2(3),
    race_1 NUMBER,
    race_2 NUMBER,
    race_3 NUMBER,
    race_4 NUMBER,
    race_5 NUMBER,
    race_6 NUMBER,
    PRIMARY KEY (unique_id),
    UNIQUE (unique_id),
    FOREIGN KEY (age, sex) REFERENCES parent_table (age, sex)
);

